[package]
name = "icrate"
version = "0.0.2" # Remember to update html_root_url in lib.rs
authors = ["Mads Marquart <mads@marquart.dk>"]
edition = "2021"
rust-version = "1.60"

description = "Bindings to Apple's frameworks"
keywords = ["macos", "ios", "cocoa", "apple", "framework"]
categories = [
    "accessibility",
    "api-bindings",
    "development-tools::ffi",
    "external-ffi-bindings",
    "os::macos-apis",
]
readme = "README.md"
repository = "https://github.com/madsmtm/objc2"
documentation = "https://docs.rs/icrate/"
license = "MIT"

[dependencies]
objc2 = { path = "../objc2", version = "=0.3.0-beta.5", default-features = false, optional = true }
block2 = { path = "../block2", version = "=0.2.0-alpha.8", default-features = false, optional = true }
dispatch = { version = "0.2.0", optional = true }

[dev-dependencies]
static_assertions = "1.1.0"

[package.metadata.docs.rs]
default-target = "x86_64-apple-darwin"
features = ["block", "objective-c", "dispatch", "unstable-frameworks-all", "unstable-private", "unstable-docsrs"]

targets = [
    # MacOS
    "x86_64-apple-darwin",
    "aarch64-apple-darwin",
    # "i686-apple-darwin",
    # iOS
    "aarch64-apple-ios",
    "x86_64-apple-ios",
    # "armv7-apple-ios",
    # "i386-apple-ios",
    # GNUStep
    "x86_64-unknown-linux-gnu",
    "i686-unknown-linux-gnu",
    # Windows
    "x86_64-pc-windows-msvc",
]

[[example]]
name = "basic_usage"
required-features = [
    "unstable-example-basic_usage"
]

[[example]]
name = "delegate"
required-features = [
    "unstable-example-delegate"
]

[[example]]
name = "speech_synthesis"
required-features = [
    "unstable-example-speech_synthesis"
]

[[example]]
name = "nspasteboard"
required-features = [
    "unstable-example-nspasteboard"
]

[[example]]
name = "browser"
required-features = [
    "unstable-example-browser"
]

[features]
default = ["std", "apple"]

# Currently not possible to turn off, put here for forwards compatibility.
std = ["alloc", "objc2?/std", "block2?/std"]
alloc = ["objc2?/alloc", "block2?/alloc"]

# Runtime selection. See `objc-sys` for details.
apple = ["objc2?/apple", "block2?/apple"]
gnustep-1-7 = ["objc2?/gnustep-1-7", "block2?/gnustep-1-7"]
gnustep-1-8 = ["gnustep-1-7", "objc2?/gnustep-1-8", "block2?/gnustep-1-8"]
gnustep-1-9 = ["gnustep-1-8", "objc2?/gnustep-1-9", "block2?/gnustep-1-9"]
gnustep-2-0 = ["gnustep-1-9", "objc2?/gnustep-2-0", "block2?/gnustep-2-0"]
gnustep-2-1 = ["gnustep-2-0", "objc2?/gnustep-2-1", "block2?/gnustep-2-1"]

# Expose features that requires Objective-C.
objective-c = ["objc2"]

# Expose features that requires creating blocks.
block = ["block2"]

# For better documentation on docs.rs
unstable-docsrs = []

# Private framework functionality
#
# These functions/methods are all marked `unsafe`, since they may not always
# exist.
unstable-private = []

# Make the `ns_string!` macro create the string statically.
#
# Please test it, and report any issues you may find:
# https://github.com/madsmtm/objc2/issues/new
unstable-static-nsstring = []

# Examples

unstable-example-basic_usage = [
    "Foundation",
    "Foundation_NSArray",
    "Foundation_NSDictionary",
    "Foundation_NSEnumerator",
]
unstable-example-delegate = [
    "apple",
    "Foundation",
    "Foundation_NSString",
    "AppKit",
    "AppKit_NSResponder",
]
unstable-example-speech_synthesis = [
    "apple",
    "Foundation",
    "Foundation_NSString",
]
unstable-example-nspasteboard = [
    "apple",
    "Foundation",
    "Foundation_NSArray",
    "Foundation_NSDictionary",
    "Foundation_NSString",
    "AppKit",
    "AppKit_NSPasteboard",
]
unstable-example-browser = [
    "apple",
    "AppKit",
    "AppKit_NSButton",
    "AppKit_NSColor",
    "AppKit_NSMenu",
    "AppKit_NSMenuItem",
    "AppKit_NSStackView",
    "AppKit_NSTextAttachmentCell",
    "AppKit_NSTextField",
    "AppKit_NSTextView",
    "AppKit_NSWindow",
    "Foundation",
    "Foundation_NSString",
    "Foundation_NSURL",
    "Foundation_NSURLRequest",
    "WebKit",
    "WebKit_WKNavigation",
    "WebKit_WKWebView",
]

# Helps with CI
unstable-frameworks-all = ["unstable-frameworks-ios", "unstable-frameworks-macos-13"]
unstable-frameworks-gnustep = ["AppKit_all", "Foundation_all"]
unstable-frameworks-gnustep-32bit = ["Foundation_all"]
# TODO: Autogenerate this
unstable-frameworks-ios = ["Foundation_all", "unstable-example-basic_usage", "unstable-example-speech_synthesis"]

# Temporary fix
Foundation_NSProxy = []

